import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expences = [
    { title: "Car Insurance", amount: "10000", date: new Date(2021, 12, 28) },
    { title: "Toilet Paper", amount: "10000", date: new Date(2021, 2, 28) },
    { title: "New TV", amount: "10000", date: new Date(2021, 4, 28) },
    { title: "Car Insurance", amount: "10000", date: new Date(2021, 5, 2) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expences[0].title}
        amount={expences[0].amount}
        date={expences[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expences[1].title}
        amount={expences[1].amount}
        date={expences[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expences[2].title}
        amount={expences[2].amount}
        date={expences[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expences[3].title}
        amount={expences[3].amount}
        date={expences[3  ].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
